source: |-
  (define sum3 0)
  (define sum5 0)
  (define sum15 0)

  (define i 0)
  (loop
      (< i 1000)
      (
          (setq sum3 (+ sum3 i))
          (setq i (+ i 3))
      )
  )

  (define t 0)
  (loop
      (< t 1000)
      (
          (setq sum5 (+ sum5 t))
          (setq t (+ t 5))
      )
  )

  (define l 0)
  (loop
      (< l 1000)
      (
          (setq sum15 (+ sum15 l))
          (setq l (+ l 15))
      )
  )

  (define total_sum (- (+ sum3 sum5) sum15))
  (write total_sum)
